import re

def extract_code(filename):
  """Extracts a three character code from a filename.

  Args:
    filename: The filename to extract the code from.

  Returns:
    A string containing the three character code, or None if an exception occurs.
  """
  try:
    match = re.search(r'(\d+)-([a-zA-Z0-9]{3})\.usfm$', filename)
    if match:
      return match.group(2)
    else:
      return None
  except:
    return None

